        "ispublic":1, "isfriend":0, "isfamily":0, "description":{"_content":"Take
        a look in the lightroom: <a href=\"http:\/\/www.flickr.com\/photos\/chizuka\/10673145855\/lightbox\/\">www.flickr.com\/photos\/chizuka\/10673145855\/lightbox\/<\/a>\n\nHinduism,
        the largest religion of India, has an abundance of gods and goddesses throughout
        the country. The most widely worshiped Hindu god deity is Lord Ganesha: The
        Elephant God. He is one of five prime Hindu deities. Ganesh, as he is commonly
        called, is an elephant-headed god who has an extensive legend. He represents
        &quot;perfect wisdom&quot; and is highly loved and worshiped by his devotees.
        Ganesh is considered to be the &quot;remover of obstacles&quot; and a &quot;bestower
        of prosperity (Gentz 382).&quot; Ganesha is also called Ganapati. &quot;Ga
        means \u2018knowledge\u2019, na means \u2018salvation\u2019, and pati \u2018lord\u2019
        (Ganesha 1)&quot;. His image can be found at the entryway of temples and in
        places of business. Ganesha is also &quot;the patron of literature. He combines
        the natures of the two most intelligent beings, man and the elephant (Alexander
        77).&quot; \n<a href=\"http:\/\/answers.yahoo.com\/question\/index?qid=20081211173324AAqEzQs\"
        rel=\"nofollow\">answers.yahoo.com\/question\/index?qid=20081211173324AAqEzQs<\/a>\n\nThis
        picture was taken at the impressive Richmond Hill Hindu Temple, near Toronto,
        Canada\nCette photo a \u00e9t\u00e9 prise \u00e0 l''impressionnant temple
        hindou de Richmond Hill, pr\u00e8s de Toronto, Canada."}, "license":"0", "dateupload":"1383608236",
